import React from "react";

function Rent() {


    return(
        <div className="registerpage">
            <div className="registertitle">
                노트북 대여 서약서
            </div>
            <div className="rentpledgecontainer">
                <div className="rentsubtitle">노트북 대여 제도 시행 지침</div>
                <div className="rentsubhead">제 1 조</div>
                <div className="rentcontent">본 시행 지침은 개인 노트북 보유 및 그 활용에 대한 활성화를 위한 노트북 대여와 관련된 시행상 주요 지침의 제정을 목적으로 한다</div>
            </div>
        </div>
    )
}

export default Rent;
